import React, { Component } from 'react';
import {Route,NavLink, BrowserRouter , Router,Switch,} from 'react-router-dom'
import Patient from './patient/patientmain';
import Doctor from './Doctor/Doctormain';
import './home.css'
class Home extends Component {
  render() {
      return (
        <div className="container">
        <>
       
        <BrowserRouter>
        <main class="main">
              {/* <div className='row'> */}
             
              <aside class="sidebar">
              
                  <ul >
                      <li>
                          <NavLink Link to='/patient' ClassName='active'>Patient</NavLink>
                      </li>
                      <li>
                          <NavLink Link to='/doctor' ClassName='active'>Doctor</NavLink>
                      </li>
                  </ul>
                  </aside>
                 
                  <div>
                      <Switch>
                          <Route exact path='/patient' component={Patient} />
                          <Route exact path='/doctor' component={Doctor} />
                      </Switch>
                  </div>
 
              {/* </div> */}
              
              </main>
          </BrowserRouter>
          
          </>
          </div>
      );
  }
}

export default Home;





































